import {Calendar, CalendarColumn, CalendarPageWrapper} from "../styled/CalendarPages.styled";
import React from 'react';

function SetupTutorAvailability() {
    return (
        <CalendarPageWrapper>
            <Calendar>
                <CalendarColumn>
                    <span>HEURE</span>
                </CalendarColumn>
            </Calendar>
        </CalendarPageWrapper>
    );
}

export default SetupTutorAvailability;
